import logo from "../src/aclogo.png";
import { Link } from "react-router-dom";

const Home = () => {
    return ( 
        <div className="home">
            <img src={logo} className="home-logo"/>
            <button>Join The Brotherhood</button>
            <Link to="/">Home</Link>
            <Link to="/Assassins">Assassins</Link>
            <Link to="/About">About</Link>
        </div>
     );
}

export default Home;
